import Contactus from '../contactus/Contactus';
import './nav.css';


function Navbar() {

  return (
    <>
      <div className='nav_container'>
        <div className='nav__logo'>
          VKEdu
        </div>
        <div>
          <a to='#'>Home</a>
          <a to='#'>About</a>
          <a to='#'>Courses</a>
          <a href={<Contactus />}>Contact Us</a>
        </div>
      </div>
    </>
  )
}

export default Navbar;
